/* eslint-disable max-len */
import {path, base64Encode, assertStrictEquals} from "std";
import * as encodeUtil from "../encodeUtil.js";

const FILES_DIR = path.join(path.dirname(path.fromFileUrl(import.meta.url)), "files");

Deno.test("petcat", async () =>
{
	const decodedData = await encodeUtil.decode(await Deno.readFile(path.join(FILES_DIR, "g>wellen")), "PETSCII");
	assertStrictEquals(base64Encode(decodedData), "");
});

Deno.test("decode", async () =>
{
	let encodedData = await encodeUtil.decode(await Deno.readFile(path.join(FILES_DIR, "BEASLEYS.DEN")), "CP437");
	assertStrictEquals(base64Encode(encodedData), "");

	encodedData = await encodeUtil.decode(await Deno.readFile(path.join(FILES_DIR, "petscii.txt")), "PETSCII");
	assertStrictEquals(base64Encode(encodedData), "");

	//encodedData = await encodeUtil.decode(await Deno.readFile(path.join(FILES_DIR, "planet of robots")), "PETSCII");
	//console.log(base64Encode(encodedData));
	//assertStrictEquals(base64Encode(encodedData), "");
});
